import React from "react";
import Navbar from "../Components/Navbar";
import Carou from "../Components/Carou";
import Footer from "../Components/Footer";
import Card from "../Components/Card";

const Home = () => {
  return (
    <>
      <div className="nav ">
        <Navbar />
      </div>
      <Carou />
      <Card />
      <Card />
      <Card />

      <div style={{ backgroundColor: "lightblue" }}>
        <Footer />
      </div>
    </>
  );
};

export default Home;
